import React from "react";
import {Switch, Route, BrowserRouter} from 'react-router-dom';
import Repositories from './Repositories';

export default function Routes(){
    return (
    <BrowserRouter>
        <Routes>
            <Route path="/repositories" element={<Repositories />} />
    
    </Routes>
</BrowserRouter>
    )
}
